import React, { useState, useEffect } from 'react';
import api from '../api';

export default function Sales({ refreshSignal, transactions = [] }) {
  const [products, setProducts] = useState([]);
  const [loadingProducts, setLoadingProducts] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchProducts = async () => {
      setLoadingProducts(true);
      setError(null);
      try {
        const res = await api.get('/products');
        setProducts(res.data || []);
      } catch (err) {
        setError('Failed to fetch products.');
      } finally {
        setLoadingProducts(false);
      }
    };

    fetchProducts();
  }, [refreshSignal]);

  // Filter sale transactions: assuming type 'deduct' and note 'sold'
  const saleTransactions = (transactions || []).filter(
    (t) => t.type === 'deduct' && t.note === 'sold'
  );

  return (
    <div className="sales-container" style={{ padding: '1rem' }}>
      <h2>Sales</h2>

      {loadingProducts && <p>Loading products...</p>}
      {error && <p style={{ color: 'red' }}>{error}</p>}

      <div className="sales-receipts" style={{ marginTop: '2rem' }}>
        <h3>Sales Receipts</h3>

        {saleTransactions.length === 0 ? (
          <p>No sales transactions available.</p>
        ) : (
          <table
            style={{
              width: '100%',
              borderCollapse: 'collapse',
              marginTop: '1rem',
            }}
          >
            <thead>
              <tr>
                <th style={{ borderBottom: '1px solid #ccc', padding: '0.5rem', textAlign: 'left' }}>
                  Date
                </th>
                <th style={{ borderBottom: '1px solid #ccc', padding: '0.5rem', textAlign: 'left' }}>
                  Product
                </th>
                <th style={{ borderBottom: '1px solid #ccc', padding: '0.5rem', textAlign: 'right' }}>
                  Quantity
                </th>
                <th style={{ borderBottom: '1px solid #ccc', padding: '0.5rem', textAlign: 'right' }}>
                  Price per Unit
                </th>
                <th style={{ borderBottom: '1px solid #ccc', padding: '0.5rem', textAlign: 'right' }}>
                  Total
                </th>
              </tr>
            </thead>
            <tbody>
              {saleTransactions.map((txn) => {
                const product = products.find((p) => p.id === txn.productId);
                const price = product ? Number(product.price || 0) : 0;
                const quantity = Number(txn.amount || 0);
                const total = (price * quantity).toFixed(2);

                return (
                  <tr key={txn.id}>
                    <td style={{ padding: '0.5rem', borderBottom: '1px solid #eee' }}>
                      {new Date(txn.date).toLocaleDateString()}
                    </td>
                    <td style={{ padding: '0.5rem', borderBottom: '1px solid #eee' }}>
                      {product ? product.name : 'Unknown Product'}
                    </td>
                    <td
                      style={{
                        padding: '0.5rem',
                        borderBottom: '1px solid #eee',
                        textAlign: 'right',
                      }}
                    >
                      {quantity}
                    </td>
                    <td
                      style={{
                        padding: '0.5rem',
                        borderBottom: '1px solid #eee',
                        textAlign: 'right',
                      }}
                    >
                      M{price.toFixed(2)}
                    </td>
                    <td
                      style={{
                        padding: '0.5rem',
                        borderBottom: '1px solid #eee',
                        textAlign: 'right',
                      }}
                    >
                      M{total}
                    </td>
                  </tr>
                );
              })}
            </tbody>
          </table>
        )}
      </div>
    </div>
  );
}
